import React from 'react';

const PracticeCard = (props) => {
    const { id, question, solutionA, solutionB, solutionC, solutionD, answer, explanations } = props.info;

    return (
            <div id={id} className="practice-card">
            <span  className="question-practice">{question}</span>
            </div>
    );
};

export default PracticeCard;
